import React from 'react';
import { Link } from 'react-router-dom';

function nav(){
    return(
        <nav>
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/userprofile">UserProfile</Link>
        </nav>
    )
}

export default nav;
